import React, { Component } from 'react';

import './App.css';



class SecondNavbar extends Component {
  render() {
    return (

      <div className="App" id="secnav_white_div" >

        <div id="secnav_div1">
          <div id="secnav_div4" ><a className="App" id="a2" href="https://www.olacabs.com/">Book Now   </a></div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <div id="secnav_div2"><a id="a2" href="https://www.olacabs.com/">app icon  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  </a> </div>

          <div id="secnav_div3"><a id="a1" href="https://www.olacabs.com/">features   &nbsp; </a>    </div>
          <div id="secnav_div3"><a id="a1" href="https://www.olacabs.com/">Ola fleet &nbsp;  </a>    </div>
          <div id="secnav_div3"><a id="a1" href="https://www.olacabs.com/">Ola Select   &nbsp;</a> </div>


        </div>


      </div>
    );
  }
}


export default SecondNavbar;
